import React, { useState } from "react";
import Video from "../../videos/videos1.mp4";
import {
  MainContainer,
  MainBackground,
  VideoBackground,
  MainContent,
  MainH1,
  MainP,
  MainBtnWrapper,
  ArrowForward,
  ArrowRight,
} from "./MainElements";

const MainSection = () => {
  const [hover, setHover] = useState(false);

  const onHover = () => {
    setHover(!hover);
  };
  return (
    <MainContainer>
      <MainBackground>
        <VideoBackground autoPlay loop muted src={Video} type="video/mp4" />
      </MainBackground>
      <MainContent>
        <MainH1>Text</MainH1>
        <MainP>Paragraph</MainP>
        <MainBtnWrapper>
          <button to="signup" onMouseLeave={onHover} onMou>
            Get Started{hover ? <ArrowForward /> : <ArrowRight />}
          </button>
        </MainBtnWrapper>
      </MainContent>
    </MainContainer>
  );
};

export default MainSection;
